window.bookSummaryJSON = "<p><b>The world reclaims all things. Humanity shelters within their ever-dying cities. Mages and Archons create the only path forward.</b><br> <br> Tala, a newly Bound Archon, strives against challenges, new and old, as the world opens up before her; even if her understanding is far from complete. Her responsibilities to her caravan have increased, with the newly added complication of being under the watchful eye of an overseer.<br> <br> Determined to embrace and decipher her newfound power, not to mention chipping away at the debt that propels her forward, she faces a treacherous path to a new city, which has already proven to be more dangerous than her journey to Alefast, and they've only just begun.<br> <br> Tala is learning valuable lessons about herself, the world around her, and the people who she is determined to protect as she settles into her new power and position as a Bound.</p>"; 
